      SELECT DISTINCT cor0.col0 / 67 AS col1 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) cor0, tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9545.out
    data: |
      0
      1
